package test.altice.labs;

import static io.restassured.RestAssured.given;
import static org.hamcrest.CoreMatchers.is;

import org.junit.jupiter.api.Test;

import io.quarkus.test.junit.QuarkusTest;

@QuarkusTest
public class LabSeqResourceTest {

    @Test
    void testLabSeqGetValueEndpointIndex3(){
        given()
            .when().get("/labseq/3")
            .then()
                .statusCode(200)
                .body("value", is("1"));
    }

    @Test
    void testLabSeqGetValueEndpointIndex15(){
        given()
            .when().get("/labseq/15")
            .then()
                .statusCode(200)
                .body("value", is("8"));
    }

    @Test
    void testLabSeqGetValueEndpointIndex50000(){
        given()
            .when().get("/labseq/50000")
            .then()
                .statusCode(200)
                .body("value", is(""));
    }

    @Test
    void testLabSeqGetValueEndpointIndex100000(){
        given()
            .when().get("/labseq/100000")
            .then()
                .statusCode(200)
                .body("value", is(""));
    }

}
